// eslint-disable-next-line
import React, { Component, Img } from 'react';
// eslint-disable-next-line
import { BrowserRouter as Router, Route, Link, Switch, Redirect } from 'react-router-dom';
// eslint-disable-next-line
import { Card, Badge, Row, Col, Button, Menu, Icon, Layout, Avatar} from 'antd';
// partials
// eslint-disable-next-line
import Calender from './partials/Calendar';
// eslint-disable-next-line
import DivBar from './partials/DivBar';
// eslint-disable-next-line
import Jumbo from './partials/Jumbo';
// css
import './App.css';
import 'antd/dist/antd.css';

const { Header, Content, Footer } = Layout;

class App extends Component {
  render() {
    return (
      <div className="App">
          <DivBar/>
          <Content style={{ padding: '0 25px' }}>
            <Jumbo/>
            <div style={{padding: 24, minHeight: 250 }}>
              yoooo
            </div>
          </Content>
          <Footer></Footer>
      </div>
    );
  }
}

export default App;
